# File READING # Returns the file lines in a list

def fileread ( filename : str ) -> list :
    try :
        with open ( filename , "r", encoding="utf-8" ) as file :
            return [ row.replace ( "\n" , "" ) for row in file.readlines ( ) ]
    except FileNotFoundError :
        return [ ]

