def give_back_tree_tile(tile, pos, to, stage):
    lista = []
    for i in tile.split(';'):
        a = i.split(':')
        lista.append(a)


    lista[0][1] = [lista[0][1].split('*')[0], stage]
    lista[0][1][0] = to

    lista[0][1] = f'{lista[0][1][0]}*{lista[0][1][1]}'

    midlist = []
    end = ''

    for x in lista:
        midlist.append(f'{str(x[0])}:{str(x[1])}')
    for y in midlist:
        end += f'{y};'

    return end

